import React from 'react';

const Dashboard = () => {
  const getGreeting = () => {
    const hour = new Date().getHours();
    if (hour < 12) return 'Good morning, ready for some laughs?';
    if (hour < 18) return 'Good afternoon, need a laugh break?';
    return 'Good evening, unwind with some memes!';
  };

  return (
    <div className="dashboard">
      <header className="header">
        <img src="/assets/logonew.jpg" alt="Logo" className="logo" />
        <h1>{getGreeting()}</h1>
      </header>
      
      <main className="main-content">
        <p className="tagline">Bringing you the best memes daily!</p>
        
        {/* Highlights Section */}
        <section className="highlights">
          <h2 className="section-title">Meme of the Day</h2>
          <div className="meme-container">
            <img src="/assets/memeoftheday.jpg" alt="Meme of the Day" className="meme-image" />
            <p className="meme-caption">Vote on your favorite meme!</p>
          </div>
        </section>
        
        {/* Social Media Links */}
        <section className="social-links">
          <h2 className="section-title">Follow Us</h2>
          <div className="icons">
            <a href="https://facebook.com/yourpage" className="social-icon">
              <i className="fab fa-facebook-f"></i> Facebook
            </a>
            <a href="https://instagram.com/yourpage" className="social-icon">
              <i className="fab fa-instagram"></i> Instagram
            </a>
            <a href="https://twitter.com/yourpage" className="social-icon">
              <i className="fab fa-twitter"></i> Twitter
            </a>
          </div>
        </section>

        {/* Navigation Links */}
        <nav className="navigation">
          <a href="/MemeGenerator" className="nav-link">Meme Generator</a>
          <a href="/chat" className="nav-link">Chat with Us</a>
        </nav>
      </main>

      {/* Footer */}
      <footer className="footer">
        <p>&copy; 2024 MEMES254KE. All rights reserved.</p>
      </footer>

      {/* Inline CSS for Modern Look */}
      <style jsx>{`
        * {
          box-sizing: border-box;
          margin: 0;
          padding: 0;
        }
        .dashboard {
          font-family: 'Roboto', sans-serif;
          color: #333;
          background-color: #f9f9f9;
          padding: 20px;
          min-height: 100vh;
          display: flex;
          flex-direction: column;
          align-items: center;
        }
        .header {
          text-align: center;
          margin-bottom: 30px;
        }
        .logo {
          width: 120px;
          margin-bottom: 15px;
          transition: transform 0.3s;
        }
        .logo:hover {
          transform: scale(1.1);
        }
        h1 {
          font-size: 2.5rem;
          color: #555;
        }
        .main-content {
          width: 100%;
          max-width: 900px;
        }
        .tagline {
          font-size: 1.2rem;
          color: #777;
          margin-bottom: 20px;
          text-align: center;
        }
        .highlights {
          background-color: #fff;
          border-radius: 10px;
          box-shadow: 0 4px 15px rgba(0, 0, 0, 0.1);
          padding: 20px;
          margin-bottom: 20px;
          text-align: center;
        }
        .section-title {
          font-size: 1.5rem;
          margin-bottom: 10px;
          color: #222;
        }
        .meme-container {
          display: flex;
          flex-direction: column;
          align-items: center;
        }
        .meme-image {
          width: 100%;
          max-width: 500px;
          border-radius: 8px;
          margin-bottom: 10px;
        }
        .meme-caption {
          font-size: 1rem;
          color: #555;
        }
        .social-links {
          margin: 20px 0;
          text-align: center;
        }
        .icons {
          display: flex;
          justify-content: center;
          gap: 20px;
        }
        .social-icon {
          color: #666;
          font-size: 1.1rem;
          text-decoration: none;
          transition: color 0.3s;
        }
        .social-icon:hover {
          color: #000;
        }
        .navigation {
          display: flex;
          justify-content: center;
          gap: 30px;
          margin: 20px 0;
        }
        .nav-link {
          color: #007bff;
          font-weight: bold;
          text-decoration: none;
          font-size: 1.2rem;
          transition: color 0.3s;
        }
        .nav-link:hover {
          color: #0056b3;
        }
        .footer {
          margin-top: auto;
          text-align: center;
          font-size: 0.9rem;
          color: #888;
        }
      `}</style>
    </div>
  );
};

export default Dashboard;
